import {VIEW_PRODUCT,ADD_PRODUCT, INITIALIZE_PRODUCT} from './Actions'



export const viewProduct = ()=>{
    return{
        type: VIEW_PRODUCT

    }
}
export const addProduct = ()=>{
    return{
        type: ADD_PRODUCT
    }
}
export const initializeProduct = (prod)=>{
    return{
        type: INITIALIZE_PRODUCT,
        products:prod}
}
